statement: |2

  リスト s=["January", "February", "March", "April", "May", "June"] の3番目から5番目の要素を取り出して出力してください。

  list(map(str, input().split()))を使ってリストを入力しよう。
  入力の時は、1つの要素おきにスペースを入れよう。
testcase:
  tests:
  - input:
    - January　February　March　April　May　June
    output: |
      ['April', 'May', 'June']
code: |
  s = list(map(str, input().split()))
  print(s[3:6])
